const emojiUrl =
  'data:image/png;base64,'

declare global {
  interface Console {
    GOOOOL: Console['log']
  }
}

console.GOOOOL = (...args: unknown[]) =>
  console.log(
    '%c ',
    `padding:0 50%;background-image:url(${emojiUrl});background-size:1em;background-repeat:repeat-x;font-size:20px;`,
    ...args,
  )
